<script>
  function time() {
      var date = new Date();
      var hour = date.getHours();
      var minutes = date.getMinutes();
      var seconds = date.getSeconds();
      if (hour < 10)
        hour = '0' + hour;
      if (minutes < 10)
        minutes = '0' + minutes;
      if (seconds < 10)
        seconds = '0' + seconds;
      var str = hour + ":" + minutes + ":" + seconds;

  }
